import React from 'react';
import { Line } from 'react-chartjs-2';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
} from 'chart.js';

// Register Chart.js components
ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend
);

const Dashboard = () => {
  // Data untuk grafik
  const data = {
    labels: ['January', 'February', 'March', 'April', 'May', 'June', 'July'],
    datasets: [
      {
        label: 'Pendapatan',
        data: [300, 500, 700, 900, 1100, 1300, 1500],
        borderColor: '#4BC0C0',
        backgroundColor: (context) => {
          const { chart } = context;
          const { ctx, chartArea } = chart;
          if (!chartArea) return;
          const gradient = ctx.createLinearGradient(0, chartArea.bottom, 0, chartArea.top);
          gradient.addColorStop(0, 'rgba(75, 192, 192, 0.4)');
          gradient.addColorStop(1, 'rgba(75, 192, 192, 0)');
          return gradient;
        },
        pointBackgroundColor: '#4BC0C0',
        pointBorderColor: '#fff',
        pointBorderWidth: 2,
        pointRadius: 6,
        tension: 0.3,
        fill: true,
        borderWidth: 3,
      },
    ],
  };

  const options = {
    responsive: true,
    maintainAspectRatio: false,
    animations: {
      tension: {
        duration: 1000,
        easing: 'easeInOutQuad',
        from: 1,
        to: 0,
        loop: true,
      },
    },
    plugins: {
      legend: {
        position: 'top',
        labels: {
          font: {
            weight: 'bold',
            size: 14,
          },
        },
      },
      tooltip: {
        backgroundColor: 'rgba(0, 0, 0, 0.7)',
        titleColor: '#fff',
        bodyColor: '#fff',
        bodyFont: {
          size: 14,
        },
        callbacks: {
          label: (tooltipItem) => `Pendapatan: Rp ${tooltipItem.raw}`,
        },
      },
    },
    scales: {
      x: {
        grid: {
          color: 'rgba(0, 0, 0, 0.1)',
        },
      },
      y: {
        beginAtZero: true,
        grid: {
          color: 'rgba(0, 0, 0, 0.1)',
        },
        ticks: {
          callback: function (value) {
            return `Rp ${value}`;
          },
        },
      },
    },
  };

  return (
    <div className="flex flex-col h-screen font-sans bg-teal-100">
      {/* Header */}
      <header className="bg-teal-200 text-teal-800 px-6 py-4 flex justify-between items-center shadow">
        <h1 className="text-xl font-bold">Admin Panel</h1>
        <div className="flex items-center">
          <span className="material-icons text-3xl mr-2">account_circle</span>
          <span>Munet</span>
        </div>
      </header>

      {/* Container */}
      <div className="flex flex-1 overflow-hidden">
        {/* Sidebar */}
        <aside className="w-48 bg-teal-700 text-white flex-shrink-0">
          <nav>
            <ul className="space-y-2 p-4">
              <li>
                <a
                  href="/Dashboard"
                  className="block px-4 py-2 rounded hover:bg-teal-600"
                >
                  Dashboard
                </a>
              </li>
              <li>
                <a
                  href="/Pendaftar"
                  className="block px-4 py-2 rounded hover:bg-teal-600"
                >
                  Pendaftar
                </a>
              </li>
              <li>
                <a
                  href="/Jadwal"
                  className="block px-4 py-2 rounded hover:bg-teal-600"
                >
                  Jadwal
                </a>
              </li>
              <li>
                <a
                  href="#"
                  className="block px-4 py-2 rounded hover:bg-teal-600"
                >
                  Keuangan
                </a>
              </li>
              <li>
                <a
                  href="#"
                  className="block px-4 py-2 rounded hover:bg-teal-600"
                >
                  Presensi
                </a>
              </li>
              <li>
                <a
                  href="/"
                  className="block px-4 py-2 rounded hover:bg-teal-600"
                >
                  Logout
                </a>
              </li>
            </ul>
          </nav>
        </aside>

        {/* Main Content */}
        <main className="flex-1 bg-teal-50 p-6 overflow-y-auto">
          <h2 className="text-2xl font-bold mb-4">Dashboard</h2>
          <p className="text-gray-700 mb-6">
            Welcome to the admin panel. Here you can manage users, view reports,
            and adjust settings.
          </p>

          {/* Cards */}
          <div className="bg-teal-200 p-6 rounded-lg shadow flex flex-col items-center text-teal-800 mb-6">
            <div className="w-48 h-48 bg-teal-800 rounded-full mb-4"></div>
            <h3 className="font-bold">NIM:</h3>
            <p className="mb-2">2218140</p>
            <h3 className="font-bold">Nama:</h3>
            <p className="mb-2">Satriya Adi Yoga</p>
            <h3 className="font-bold">Tempat, Tanggal Lahir:</h3>
            <p className="mb-2">Malang, 10 November 2002</p>
            <h3 className="font-bold">Alamat:</h3>
            <p className="mb-2">Malang</p>
            <h3 className="font-bold">No Tlp:</h3>
            <p className="mb-2">0393817665416</p>
            <h3 className="font-bold">Email:</h3>
            <p className="mb-2">munet@gmail.com</p>
          </div>

          {/* Grafik */}
          <div className="bg-white p-6 rounded-lg shadow mb-6">
            <h3 className="text-xl font-semibold mb-4">Pendapatan Grafik</h3>
            <div className="h-96">
              <Line data={data} options={options} />
            </div>
          </div>
        </main>
      </div>
    </div>
  );
};

export default Dashboard;
